import styled from 'styled-components';

export const NavBarBackground = styled.img<{ imageSrc: string }>(
    ({imageSrc}) =>
    `
    background-image: url(${imageSrc}); 
    min-height: 64px;
    min-width: 100%;
    position:static;
    width: 100%;
    height: 100%;
    `
);

export const NavBarContainer = styled.div
    `
    width: 100%;;
    height: 100px;
    text-align: center;
    `;
